import React from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";
import "./navbar.css";

const Navbar: React.FC = () => {
  return (
    <div className="navbar">
      <button id="" ><img className="logo" src="/assets/logos/logo.svg" /></button>
      <div className="menu">

        <div className="menu-left">
          <button id="">Restaurants</button>
          <button id="">Chefs</button>
        </div>

        <div className="menu-right">
        <input type="text" name="search" placeholder="Search for restaurant cuisine, chef" />
          {/* <button id="" ><img className="menu-icons" src="/assets/logos/search_button.svg" /></button> */}
          <button id="" ><img className="menu-icons" src="/assets/logos/person_button.svg" /></button>
          <button id="" ><img className="menu-icons" src="/assets/logos/shopping_bag_button.svg" /></button>
        </div>

      </div>
    </div>
  );
};

export default Navbar;
